import StatusDot from  '../shared/StatusDot'
export default function Users({usersData}) {
    const users = usersData ||
        Array(10).fill({
            first_name: 'First',
            last_name: 'Last',
            role: 'Project Lead',
            avatar: `http://place-puppy.com/200x300`,
            city: 'New York'
        }
    )
    const CardGenerator = () => {

        const Card = ({user, id}) => {
            return (
                <div className='w-32 pl-4 pt-4'>
                    <img src={users[id].avatar} className='w-full h-32 rounded-full shadow'/>
                    <div className="text-left w-full leading-tight">
                        <h3 className="text-lg font-f1">{users[id].first_name+' '+users[id].last_name}</h3>
                        <p className='text-xs font-f1 font-thin'>{users[id].role}</p>
                        <p className='text-xs font-f1 font-thin'>{users[id].city}</p>
                        <div className='font-thin text-xs font-c1 flex items-center'>
                            <p>Online</p>
                            <StatusDot color='green-400'/>
                        </div>
                    </div>
                </div>
            )
        }
        const cards = users.map((user, i) => (<Card user={user} id={i} />))
        return cards
    }
    const grid = `w-5/12 overflow-x-scroll grid grid-cols-${users.length} col-gap-40 grid-flow-col>`
    return(
        <div className={grid}>
            <CardGenerator />
        </div>
    )
}
